import React from 'react'
// import MessagesBox from './components/MessagesBox.jsx';

function App() {
    const [messages, setMessages] = React.useState({});
    React.useEffect(() => {
        fetch("http://127.0.0.1:8000/acess/treinamento_final31.jsonl/0", {
            method: "GET"
        })
        .then(response => response.json())
        .then(data => {
            const messagesComponents = data.jsonline.messages.map(message => {
                return <MessagesBox text={JSON.stringify(message.content)} role={message.role} />
            })
            setMessages(messagesComponents)
        })
        .catch(err => console.log(err));
    }, []);

    return(
        <p>{messages ? "existe" : "Não existe"}</p>
    )
}

export default App;
